import React,{useState, useEffect} from 'react'; 
import {Form, Button} from 'react-bootstrap';

export default function TampilBarang() {
	
	return(
		<>
		<h1>Data Penjualan</h1>		
		<Form.Control type="text" onChange={(e) => {setNamaBarang(e.target.value)}} />
		<Form.Control type="number" onChange={(e) => {setStokBarang(e.target.value)}} />
		<Form.Control type="number" onChange={(e) => {setJumlahTerjual(e.target.value)}} />
		<Form.Control type="date" onChange={(e) => {setTanggalTransaksi(e.target.value)}} />
		<Form.Select aria-label="Default select Example">
			<option></option>
			<option value="1">Konsumsi</option>
			<option value="2">Konsumsi</option>
		</Form.Select>
		<br />
		<Button variant="primary">Tambah Data</Button>
		</>
		);
}
